"use strict";(self.webpackChunkportfolio=self.webpackChunkportfolio||[]).push([[6943],{2682:e=>{e.exports=JSON.parse('{"label":"Github","permalink":"/portfolio/docs/tags/github","allTagsPath":"/portfolio/docs/tags","count":12,"items":[{"id":"Developer/Git/advanced-git","title":"advanced-git","description":"Git Shortcuts","permalink":"/portfolio/docs/Developer/Git/advanced-git"},{"id":"Developer/Assistant-SDK/hardware-and-network","title":"Configure and Test Audio","description":"\x3c!--","permalink":"/portfolio/docs/Developer/Assistant-SDK/hardware-and-network"},{"id":"Developer/release-notes","title":"HBO Max Release Notes","description":"This page is not reflective of an actual document sent to partners. Rather it is an overview of the release notes, and the site (which I built) that the release notes are for.","permalink":"/portfolio/docs/Developer/release-notes"},{"id":"Specifications/media-manifest-core","title":"HBO Media Manifest Core","description":"The purpose of this document is to document and define WarnerMedia\'s requirements for the successful delivery of content and technical metadata using MovieLabs Media Manifest Core (MMC).","permalink":"/portfolio/docs/Specifications/media-manifest-core"},{"id":"Specifications/HBO-SDR_Spec","title":"HBO Standard-Definition Range Content Specification","description":"The purpose of this document is to facilitate and define WarnerMedia\'s requirements for the successful acquisition of Standard Dynamic Range (SDR) Licensed Content from external parties. This specification establishes the composition and technical requirements for all aspects of the delivery to which external parties must comply to complete the content acquisition process.","permalink":"/portfolio/docs/Specifications/HBO-SDR_Spec"},{"id":"Developer/Assistant-SDK/install-sdk","title":"Install the SDK and Sample Code","description":"Follow these instructions to install the SDK and sample code in your project. Run all of the commands on this page in a terminal on the device (either directly or via an SSH connection).","permalink":"/portfolio/docs/Developer/Assistant-SDK/install-sdk"},{"id":"Developer/Git/git-setup","title":"Overview","description":"One question frequently asked by aspiring technical writers is: How do I gain the requisite experience? And typically, responders say to join an open source project or something similar. While working on projects is a great way to gain experience, technical writers can also begin simply by setting up their own git-based environement\u2014even if it just used to publish notes or a personal portfolio.","permalink":"/portfolio/docs/Developer/Git/git-setup"},{"id":"Developer/Git/gitlab","title":"Overview","description":"This guide provides instructions for establishing a connection with the GitLab repo for the Partner Hub. By the end, you will:","permalink":"/portfolio/docs/Developer/Git/gitlab"},{"id":"Developer/Git/master-git","title":"Overview","description":"At this point in the Git Collection you should understand what Git is and how to use it. This post takes all the lessons learned so far and takes them a step further by looking at branching (which is typical for projects with multiple contributors).","permalink":"/portfolio/docs/Developer/Git/master-git"},{"id":"Developer/Assistant-SDK/register-device","title":"Register the Device Model","description":"In order for the Google Assistant to respond to commands appropriate to your device and the given context, the Assistant needs information about your particular device. You provide this information, which includes fields like device type and manufacturer, as a device model. You can think of this model as a general class of device -- such as a light, speaker, or toy robot.","permalink":"/portfolio/docs/Developer/Assistant-SDK/register-device"},{"id":"Developer/Assistant-SDK/run-sample-code","title":"Run the Sample Code","description":"At this point, you are ready to run the sample and make a query.","permalink":"/portfolio/docs/Developer/Assistant-SDK/run-sample-code"},{"id":"intro","title":"Welcome to Ashton\'s Portfolio","description":"Here is a collection of projects I\'ve completed over the past decade. Each project is grouped according to the intended audience. At the top of each doc is an introduction to the doc, including: my role in the project, doc publishing, and where I obtained the information to create the content.","permalink":"/portfolio/docs/intro"}]}')}}]);